  input: TEXT,F3XA,,"This submission and amendment is in response to a letter dated
    December 1, 2004 requesting further information about the federal election campaign
    finances for Driving Votes.  1) Please clarify all expenditures made for 'printing,'
    'printing and production,' and 't-shirt printing' on Schedule(s) B....  Eleven
    of the thirteen itemized disbursements on Schedule B related to 'printing,' 'printing
    and production, ' and 't-shirt printing' are reported correctly and do not specifically
    identify federal candidates.  After further review, however, it was brought to
    my attention that two of the itemized disbursements should have been listed on
    Schedule E as independent expenditures.  These two items, a disbursement on 9/27/04
    to Diesel Fuel Prints in the amount of $1075.00 and a disbursement on 9/27/04
    to Kinko's in the amount of $432.48, are disclosed correctly on this amended report.  2)
    Your report discloses limited payments for administrative expenses....  Driving
    Votes administrative expenses are limited because we do not have an office and
    therefore do not have many of the subsequent administrative costs associated with
    an office.  All employee salaries have been adequately disclosed in our filing.  Volunteers
    did all other work.  If you have any further questions please contact me at the
    Committee's address.  Thank you.  Richard Davidson, Treasurer"
